import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Plus = createReactComponent("Plus", ["svg", defaultAttributes, [["line", {
  x1: "12",
  y1: "5",
  x2: "12",
  y2: "19",
  key: "1ebv7v"
}], ["line", {
  x1: "5",
  y1: "12",
  x2: "19",
  y2: "12",
  key: "iqslzh"
}]]]);
export default Plus;
